script: |
  super -f tsv -I q10021.sql | sort > q10021.out

vector: true

inputs:
  - name: q10021.sql
    data: |
      SELECT + 91 AS col0 FROM tab2 WHERE NOT + ( + - col1 ) IN ( + - CASE 82 WHEN col1 * + col1 THEN NULL ELSE - 64 END, - col0, 30 ) GROUP BY col1, col2;
  - name: tab2

outputs:
  - name: q10021.out
    data: |
      91
      91
      91
